import TrainBtn from "../Elements/TrainBtn";

function TrainsPanel({trainManager, focusOnTrainClick}) 
{
    const handleTrainClick = (train_index) =>
    {
      focusOnTrainClick(train_index);
      console.log("View changed to train: ", train_index);
    };

    return (
      <>
        <h2>Active Trains</h2>
        {trainManager.trains.map((train, index) =>(
          <TrainBtn key={index} handleTrainClick={handleTrainClick} train={train}/>
        ))}
      </>
    );
}

  
export default TrainsPanel;
